import React from 'react';
import Logo from '../images/prinscarl_logo.png'
import styled from 'styled-components'

const Header = () => {

    return (
    <>
    <Image src={Logo} alt="Prins Carl Logo" />
    </>
    )
}

export default Header;

const Image = styled.image`
Height: 40px;
`
